    bar: {
        height: '100vh',
        width: '7%',
        backgroundColor: 'rgb(24,24,24',
        float: 'left',
        textAlign: 'center'

    },
    black: {
        backgroundColor: 'black',
        marginBottom: "25vh"

    },
    icons: {
        width: '70%'
    }
}

const Sidebar = () => {

    return(

        <React.Fragment>
            <div style={styles.bar}>
                <div style={styles.black}>
                <div className="w3-padding w3-xxxlarge w3-text-white">
                <a href='/'><i className="fa fa-home"></i></a>
                </div>
                </div>


                <div className="w3-padding w3-xxxlarge w3-text-white">

                <a href='/'><i className="fa fa-user-circle"></i></a>
                <a href='/'><i className="fas fa-cog"></i></a>
                <a href='/'><i className="fa fa-user-circle"></i></a>
                </div>

                </div>

        </React.Fragment>
    )
}
export default Sidebar
